ApiManager.prototype.GameApi = function (player, prevGameMode, param) {
  var result = {
    tw: "0.00", ///////////
    balance: "111,184.00", //////
    index: "255", ////////////
    balance_cash: "111,184.00", //////
    reel_set: "0",
    balance_bonus: "0.00",
    na: "s", ///////////////
    mbri: "1,2,3,4",
    stime: "1648282175271",
    sa: "11,9,11,12,7,11", ////
    sb: "12,12,10,5,12,5", ////
    sh: "4",
    c: "208.00", ////////////
    sver: "5",
    counter: "510", ///////////
    l: "10",
    s: "3,9,11,7,11,9,8,9,4,9,9,12,7,9,10,9,6,7,10,4,10,9,8,10", /////
    w: "0.00", ////////////
    mbr: "1,1,1,1",
  };

  //            
  result["balance_cash"] = player.balance;
  result["balance"] = player.balance;
  result["c"] = player.betPerLine;
  result["counter"] = ++param.counter;
  result["index"] = param.index;

  var nextAction = "s";
  if (player.machine.winMoney > 0) {
    nextAction = "c";
    var winLines = player.machine.winLines;
    for (var i = 0; i < winLines.length; i++) {
      result[`l${i}`] = winLines[i];
    }
  }
  result["na"] = nextAction;
  result["s"] = Util.view2String(player.machine.view);
  result["sa"] = Util.view2String(player.machine.virtualReels.above);
  result["sb"] = Util.view2String(player.machine.virtualReels.below);
  result["stime"] = new Date().getTime();
  result["tw"] = player.machine.winMoney;
  result["w"] = player.machine.winMoney;

  if (player.machine.multisPos.length > 0) {
    result["mbp"] = Util.view2String(player.machine.multisPos);
    result["mbv"] = Util.view2String(player.machine.multisValue);
  }
  if (player.machine.baseType == 2) {
    var mbr = [1,1,1,1];
    mbr[player.machine.multiReelPos - 1] = player.machine.multiValue;
    result["mbr"] = mbr.join();
    result["is"] = Util.view2String(player.machine.maskView);
    result["stf"] = player.machine.viewToMask;
  }

  if (prevGameMode == "BASE") {
    if (player.machine.currentGame == "FREE") {
      result["bgid"] = 0;
      result["bgt"] = 30;
      result["bw"] = 1;
      result["coef"] = player.totalBet;
      result["end"] = 0;
      result["level"] = 0;
      result["lifes"] = 1;
      result["na"] = "b";

      if(player.machine.freeSpinCacheList[0].isBuy){
        result["puri"] = 0;
        result["purtr"] = 1;
      }

      if (player.machine.scatterCount > 3) {
        result["psym"] = player.machine.psym;
      }
      result["rw"] = 0;
      result["status"] = "0,0";
      result["wins_mask"] = "nff,nff";
      result["wins"] = "10,8";
      result["wp"] = 0;
    }
  } else if (prevGameMode == "FREE") {
    if (player.machine.freeSpinCacheList[0].isBuy) {
      result["puri"] = 0;
    }
    if (player.machine.currentGame == "FREE") {
      result["na"] = "s";
      result["fs"] = player.machine.freeSpinIndex;
      result["fsmax"] = player.machine.freeSpinLength;
      result["fsmul"] = 1;
      result["fswin"] = player.machine.freeSpinWinMoney;
      result["fsres"] = player.machine.freeSpinWinMoney;
      result["tw"] = player.machine.totalWin;
      result["mbri"] = "1,2,3,4";
      result["mbr"] = "1,1,1,1";

      if (player.machine.freeSpinType == 0) { /////////////////////////////          EXTEN WILD         //////////////////////////////
        if (player.machine.freeWildType == 1) {
          result["mbp"] = player.machine.multiPos;
          result["mbv"] = "1";
          result["rs_c"] = "1";
          result["rs_m"] = "1";
          result["rs"] = "mc";
          result["rs_p"] = 0;
          result["stf"] = player.machine.viewToMask;
          result["is"] = Util.view2String(player.machine.maskView);
        } else if (player.machine.freeWildType == 2) {
          result["mbp"] = Util.view2String(player.machine.multisPos);
          result["mbv"] = Util.view2String(player.machine.multisValue);
          var mbr = [1,1,1,1];
          mbr[(player.machine.multiPos % 6) - 1] = player.machine.respinCount;
          result["mbr"] = mbr.join();
          result["rs_c"] = "1";
          result["rs_m"] = "1";
          result["rs"] = "mc";
          result["rs_p"] = player.machine.respinCount;
          result["rs_win"] = player.machine.respinWin;
        } else if (player.machine.freeWildType == 3) {
          result["mbp"] = Util.view2String(player.machine.multisPos);
          result["mbv"] = Util.view2String(player.machine.multisValue);
          var mbr = [1, 1, 1, 1];
          mbr[(player.machine.multiPos % 6) - 1] = player.machine.respinCount;
          result["mbr"] = mbr.join();
          result["rs_t"] = player.machine.respinCount;
          result["rs_win"] = player.machine.respinWin;
        }

      } else if (player.machine.freeSpinType == 1) {   ////////////////////////////////     Free Sticky      ////////////////////////////////////////
        if (player.machine.stWildsPos.length > 0) {
          result["mbp"] = Util.view2String(player.machine.stWildsPos);
          result["mbv"] = Util.view2String(player.machine.stWildsValue);
        }
        if (player.machine.stickyFlag == true) {
          result["is"] = Util.view2String(player.machine.maskView);
          result["stf"] = player.machine.viewToMask;
        }
        result["trail"] = "special_symbol~" + `${player.machine.specialSymbol}`;
      }
    } //                                     ->                       
    else if (player.machine.currentGame == "BASE") {
      if (player.machine.freeSpinType == 0) {    ///// Exten wild end
        result["tw"] = player.machine.totalWin;
        if (player.machine.freeWildType == 3) {
          result["mbp"] = Util.view2String(player.machine.extenWilds);
          result["mbv"] = Util.view2String(player.machine.extenWildsValue);
          result["mbr"] = Util.view2String(player.machine.extenWildsPos);
          result["rs_t"] = player.machine.respinCount;
          result["rs_win"] = player.machine.respinWin;
        }
      } else if (player.machine.freeSpinType == 1) {    /// sticky wild end
        result["tw"] = player.machine.totalWin;
        if (player.machine.stWildsPos.length > 0) {
          result["mbp"] = Util.view2String(player.machine.stWildsPos);
          result["mbv"] = Util.view2String(player.machine.stWildsValue);
        }
        if (player.machine.stickyFlag == true) {
          result["is"] = Util.view2String(player.machine.maskView);
          result["stf"] = player.machine.viewToMask;
        }
        result["trail"] = "special_symbol~" + `${player.machine.specialSymbol}`;
      }

      result["na"] = "c";
      result["fs_total"] = player.machine.freeSpinLength;
      result["fsmul_total"] = 1;
      result["fsend_total"] = 1;
      result["fswin_total"] = player.machine.freeSpinWinMoney;
      result["fsres_total"] = player.machine.freeSpinWinMoney;
    }
  }

  return result;
};

